Fathom: Dawn of War - The Complete Saga

English | CBR | 6 Issues

Genre: Action/Adventure, Fantasy, Science Fiction

Written by Talent Caldwell,
Art by Talent Caldwell,

With the new Fathom series in full swing, Aspen is proud to offer you the story that sparked the war, and brought the world of Fathom to its knees, Fathom: Dawn of War!

Fathom: Dawn of War collects issues #0, 1, 2, 3, Beginnings and Cannon Hawke. This special edition contains the entire tale of warfare and betrayal that led up to the battle between the humans and the Blue, and the unheralded surfacing of the Black! Find out for yourself why Dawn of War became one of the most pivotal storylines in Fathom history! Brought to you by the creative of J. T. Krul, Talent Caldwell, Jason Gorder and Christina Strain, and featuring a brand new cover by Fathom creator Michael Turner, this edition is a definite must for any Fathom fan!

